import './App.css';
import React from "react";
import Header from "./components/Header/Header";
import Nav from "./components/Navbar/Nav";
import Profile from "./components/Profile/Profile";

const App = () => {
    return (
        <div className='app-wrapper'>
            <Header/>

            <div className='nav'>
                <Nav/>
            </div>

            <div className='content'>
                <Profile/>
            </div>

        </div>
    );
}

export default App;
